import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// @material-ui/icons
import Person from "@material-ui/icons/Person";
import EmojiObjectsIcon from '@material-ui/icons/EmojiObjects';
import Favorite from "@material-ui/icons/Favorite";
// core components
import Header from "components/Header/Header.js";
import Footer from "components/Footer/Footer.js";
import Button from "components/CustomButtons/Button.js";
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import HeaderLinks from "components/Header/HeaderLinks.js";
import NavPills from "components/NavPills/NavPills.js";
import Parallax from "components/Parallax/Parallax.js";

import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import Typography from '@material-ui/core/Typography';
import ButtonBase from '@material-ui/core/ButtonBase';

import styles from "assets/jss/material-kit-react/views/resultsPage/resultsStyle.js";

const useStyles = makeStyles(styles);

export default function ProfilePage(props) {
  const classes = useStyles();
  const { ...rest } = props;

  const giftIdeas = [
    {
      id: 1,
      name: "Video Game",
      description: "The coolest upcoming game"
    }
  ]
  return (
    <div>
      <Header
        color="transparent"
        brand="Material Kit React"
        rightLinks={<HeaderLinks />}
        fixed
        changeColorOnScroll={{
          height: 200,
          color: "white"
        }}
        {...rest}
      />
      <Parallax small filter image={require("assets/img/profile-bg.jpg")} />
      <div className={classNames(classes.main, classes.mainRaised)}>
        <div>
          <div className={classes.container}>
            <h2 className={classes.title}>Your Results:</h2>
            <GridContainer justify="center">
              <GridItem xs={12} sm={12} md={10} className={classes.navWrapper}>
                <NavPills
                  alignCenter
                  color="rose"
                  tabs={[
                    {
                      tabButton: "Type",
                      tabIcon: Person,
                      tabContent: (
                        <>
                        <h2>You're gift recieving type is <b>INTP</b></h2>
                        <img src={require("assets/img/intp.png")} />
                        <p className={classes.typeDescription}>
                        INTPs have extremely eclectic taste when it comes to gifts. They aren’t as easy to pin down as some types are, but
                         it also makes for a more exciting experience trying to track down just the right thing! For the most part INTPs enjoy
                          the holidays as long as they aren’t expected to attend every party and make small talk with every extended family member.
                           They enjoy the food, spending time with their dearest friends, and the extra time off work to relax and catch up on some
                            of their favorite activities.<br /><br />

                          INTPs tend to be relatively easy-going about receiving gifts. They appreciate the thought that goes into the gift and about
                           80% of the INTPs I spoke with said that they usually enjoyed their presents and figured they were easy to buy for. The other
                            20% of the INTPs I spoke with (I spoke with roughly 70 INTPs) said that they were difficult to buy for because they just
                             purchase what they want when they want it and have a hard time thinking of something they want that they don’t already have 
                             (besides cash).<br /><br />

                          Many INTPs are apprehensive about public gift-giving. They can feel self-conscious opening presents around other people who are 
                          anticipating a response. They can worry about whether they seem surprised or happy enough, and can also worry about the “contracts”
                           of gift-giving. They want to feel free to give to whom they wish and to not have to shop for people they don’t know very well yet.
                            If you’re buying an INTP a gift, but don’t know them very well, make sure to make it clear that you’re just doing this for fun but
                             you don’t want something in return.<br /><br />

                          When it comes to giving gifts, INTPs tend to be thoughtful and considerate, but they usually aren’t interested in buying things for 
                          large groups of extended family and people at the office. They enjoy buying gifts for very loyal and close friends and family members.
                        </p>
                        </>
                      )
                    },
                    {
                      tabButton: "Gift Ideas",
                      tabIcon: EmojiObjectsIcon,
                      tabContent: (
                        <div className={classes.root}>
                        <Paper className={classes.paper}>
                          <Grid container spacing={2}>
                            <Grid item>
                              <ButtonBase className={classes.image}>
                                <img className={classes.img} alt="complex" src="/static/images/grid/complex.jpg" />
                              </ButtonBase>
                            </Grid>
                            <Grid item xs={12} sm container>
                              <Grid item xs container direction="column" spacing={2}>
                                <Grid item xs>
                                  <Typography gutterBottom variant="subtitle1">
                                    Standard license
                                  </Typography>
                                  <Typography variant="body2" gutterBottom>
                                    Full resolution 1920x1080 • JPEG
                                  </Typography>
                                  <Typography variant="body2" color="textSecondary">
                                    ID: 1030114
                                  </Typography>
                                </Grid>
                                <Grid item>
                                  <Typography variant="body2" style={{ cursor: 'pointer' }}>
                                    Remove
                                  </Typography>
                                </Grid>
                              </Grid>
                              <Grid item>
                                <Typography variant="subtitle1">$19.00</Typography>
                              </Grid>
                            </Grid>
                          </Grid>
                        </Paper>
                      </div>
                      )
                    }
                  ]}
                />
              </GridItem>
            </GridContainer>
            <h3>Share your results!</h3>
          </div>
        </div>
      </div>
      <Footer />
    </div>
  );
}
